import React from 'react';
import style from './Terms.module.css';

function Terms() {
    return (
        <div>
            <style dangerouslySetInnerHTML={{ __html: "
  [data-custom-class='body'], [data-custom-class='body'] * {
          background: transparent !important;
        }
[data-custom-class='title'], [data-custom-class='title'] * {
          font-family: Arial !important;
font-size: 26px !important;
color: #000000 !important;
        }
[data-custom-class='subtitle'], [data-custom-class='subtitle'] * {
          font-family: Arial !important;
color: #595959 !important;
font-size: 14px !important;
        }
[data-custom-class='heading_1'], [data-custom-class='heading_1'] * {
          font-family: Arial !important;
font-size: 19px !important;
color: #000000 !important;
        }
[data-custom-class='heading_2'], [data-custom-class='heading_2'] * {
          font-family: Arial !important;
font-size: 17px !important;
color: #000000 !important;
        }
[data-custom-class='body_text'], [data-custom-class='body_text'] * {
          color: #595959 !important;
font-size: 14px !important;
font-family: Arial !important;
        }
[data-custom-class='link'], [data-custom-class='link'] * {
          color: #3030F1 !important;
font-size: 14px !important;
font-family: Arial !important;
word-break: break-word !important;
        }
" }} />
            <div data-custom-class="body">
                <div><strong><span style={{ fontSize: '26px' }}><span data-custom-class="title">PRIVACY NOTICE</span></span></strong></div><div><br /></div><div><span style={{ color: 'rgb(127, 127, 127)' }}><strong><span style={{ fontSize: '15px' }}><span data-custom-class="subtitle">Last updated <bdt className="question">March 10, 2021</bdt></span></span></strong></span></div><div><br /></div><div><br /></div><div><br /></div><div style={{ lineHeight: '1.5' }}><span style={{ color: 'rgb(127, 127, 127)' }}><span style={{ color: 'rgb(89, 89, 89)', fontSize: '15px' }}><span data-custom-class="body_text">Thank you for choosing to be part of our community at <bdt className="question">FindDevs</bdt><span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><bdt className="block-component" /></span></span> ("<span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><bdt className="block-component" /></span></span><strong>Company</strong></span><span style={{ color: 'rgb(127, 127, 127)' }}><span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><bdt className="statement-end-if-in-editor"><span data-custom-class="body_text" /></bdt></span></span></span></span></span><span data-custom-class="body_text">", "<strong>we</strong>", "<strong>us</strong>", "<strong>our</strong>"). We are committed to protecting your personal information and your right to privacy. If you have any questions or concerns about this privacy notice, or our practices with regards to your personal information, please contact us at <bdt className="question">contact@finddevs.io</bdt>.</span></span></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><br /></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><span style={{ color: 'rgb(127, 127, 127)' }}><span data-custom-class="body_text">When you <span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><bdt className="block-component" /></span></span>visit our website <bdt className="question"><a href="http://www.finddevs.io" target="_blank" data-custom-class="link">http://www.finddevs.io</a></bdt> (the "<strong>Website</strong>"), <span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><bdt className="statement-end-if-in-editor" /><bdt className="block-component" /><bdt className="block-component" /></span></span> and more generally, use any of our services (the "<strong>Services</strong>", which include the&nbsp;</span><span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><bdt className="block-component"><span data-custom-class="body_text" /></bdt>Website<span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><bdt className="statement-end-if-in-editor" /></span></span><bdt className="block-component" /></span></span></span><span data-custom-class="body_text"><span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><bdt className="block-component" /></span></span></span></span></span><span data-custom-class="body_text">), we appreciate that you are trusting us with your personal information. We take your privacy very seriously. In this privacy notice, we seek to explain to you in the clearest way possible what information we collect, how we use it and what rights you have in relation to it. We hope you take some time to read through it carefully, as it is important. If there are any terms in this privacy notice that you do not agree with, please discontinue use of our Services immediately.</span></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><br /></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><span style={{ color: 'rgb(127, 127, 127)' }}><span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text">This privacy notice applies to all information collected through our Services (which, as described above, includes our&nbsp;</span><span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><bdt className="block-component"><span data-custom-class="body_text" /></bdt>Website<span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><bdt className="statement-end-if-in-editor" /></span></span><bdt className="block-component"><bdt className="block-component" /></bdt></span></span></span></span></span><span data-custom-class="body_text">), as well as, any related services, sales, marketing or events.</span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><br /></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><span style={{ color: 'rgb(127, 127, 127)' }}><span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><strong>Please read this privacy notice carefully as it will help you understand what we do with the information that we collect.</strong></span></span></span></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><br /></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><span style={{ color: 'rgb(127, 127, 127)' }}><span style={{ color: 'rgb(0, 0, 0)' }}><strong><span data-custom-class="heading_1">TABLE OF CONTENTS</span></strong></span></span></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><br /></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><a data-custom-class="link" href="#infocollect"><span style={{ color: 'rgb(89, 89, 89)' }}>1. WHAT INFORMATION DO WE COLLECT?</span></a><span style={{ color: 'rgb(127, 127, 127)' }}><span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><span style={{ color: 'rgb(89, 89, 89)' }}><bdt className="block-component" /></span></span></span></span></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><a data-custom-class="link" href="#infouse"><span style={{ color: 'rgb(89, 89, 89)' }}>2. HOW DO WE USE YOUR INFORMATION?</span></a><span style={{ color: 'rgb(127, 127, 127)' }}><span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><span style={{ color: 'rgb(89, 89, 89)' }}><span style={{ color: 'rgb(89, 89, 89)' }}><bdt className="statement-end-if-in-editor" /></span></span></span></span></span></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><span style={{ color: 'rgb(89, 89, 89)' }}><a data-custom-class="link" href="#infoshare">3. WILL YOUR INFORMATION BE SHARED WITH ANYONE?</a></span><span style={{ color: 'rgb(127, 127, 127)' }}><span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><span style={{ color: 'rgb(89, 89, 89)' }}><bdt className="block-component" /></span><bdt className="block-component" /><span style={{ color: 'rgb(89, 89, 89)' }}><bdt className="block-component" /><bdt className="block-component" /></span></span><bdt className="block-component" /><bdt className="block-component" /></span></span></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><a data-custom-class="link" href="#inforetain"><span style={{ color: 'rgb(89, 89, 89)' }}>4. HOW LONG DO WE KEEP YOUR INFORMATION?</span></a><span style={{ color: 'rgb(127, 127, 127)' }}><span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><span style={{ color: 'rgb(89, 89, 89)' }}><span style={{ color: 'rgb(89, 89, 89)' }}><bdt className="block-component" /></span></span></span></span></span></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><a data-custom-class="link" href="#infosafe"><span style={{ color: 'rgb(89, 89, 89)' }}>5. HOW DO WE KEEP YOUR INFORMATION SAFE?</span></a><span style={{ color: 'rgb(127, 127, 127)' }}><span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><span style={{ color: 'rgb(89, 89, 89)' }}><bdt className="statement-end-if-in-editor" /><bdt className="block-component" /></span></span></span></span></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><a data-custom-class="link" href="#infominors"><span style={{ color: 'rgb(89, 89, 89)' }}>6. DO WE COLLECT INFORMATION FROM MINORS?</span></a><span style={{ color: 'rgb(127, 127, 127)' }}><span style={{ color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><span style={{ color: 'rgb(89, 89, 89)' }}><bdt className="statement-end-if-in-editor" /></span></span></span></span></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><span style={{ color: 'rgb(89, 89, 89)' }}><a data-custom-class="link" href="#privacyrights">7. WHAT ARE YOUR PRIVACY RIGHTS?</a></span></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><a data-custom-class="link" href="#DNT"><span style={{ color: 'rgb(89, 89, 89)' }}>8. CONTROLS FOR DO-NOT-TRACK FEATURES</span></a></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><a data-custom-class="link" href="#caresidents"><span style={{ color: 'rgb(89, 89, 89)' }}>9. DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?</span></a></span></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px' }}><a data-custom-class="link" href="#policyupdates"><span style={{ color: 'rgb(89, 89, 89)' }}>10. DO WE MAKE UPDATES TO THIS NOTICE?</span></a></span></div><div style={{ lineHeight: '1.5' }}><a data-custom-class="link" href="#contact"><span style={{ color: 'rgb(89, 89, 89)', fontSize: '15px' }}>11. HOW CAN YOU CONTACT US ABOUT THIS NOTICE?</span></a></div><div style={{ lineHeight: '1.5' }}><a data-custom-class="link" href="#request"><span style={{ color: 'rgb(89, 89, 89)' }}>12. HOW CAN YOU REVIEW, UPDATE OR DELETE THE DATA WE COLLECT FROM YOU?</span></a></div><div style={{ lineHeight: '1.5' }}><br /></div><div id="infocollect" style={{ lineHeight: '1.5' }}><span style={{ color: 'rgb(127, 127, 127)' }}><span style={{ color: 'rgb(89, 89, 89)', fontSize: '15px' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span id="control" style={{ color: 'rgb(0, 0, 0)' }}><strong><span data-custom-class="heading_1">1. WHAT INFORMATION DO WE COLLECT?</span></strong><span data-custom-class="heading_1"><bdt className="block-component"><span data-custom-class="body_text" /></bdt></span></span></span></span></span></span></div><div style={{ lineHeight: '1.5' }}><span data-custom-class="heading_2" style={{ color: 'rgb(0, 0, 0)' }}><span style={{ fontSize: '15px' }}><strong><u><br /></u></strong><strong>Personal information you disclose to us</strong></span></span></div><div><div><br /></div><div style={{ lineHeight: '1.5' }}><span style={{ color: 'rgb(127, 127, 127)' }}><span style={{ color: 'rgb(89, 89, 89)', fontSize: '15px' }}><span data-custom-class="body_text"><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><strong><em>In Short:&nbsp;</em></strong></span></span></span></span><span data-custom-class="body_text"><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><strong><em>&nbsp;</em></strong><em>We collect personal information that you provide to us.</em></span></span></span></span></span></span></div></div><div style={{ lineHeight: '1.5' }}><br /></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text">We collect personal information that you voluntarily provide to us when you <span style={{ fontSize: '15px' }}><bdt className="block-component" /></span>register on the&nbsp;</span><span style={{ fontSize: '15px' }}><span data-custom-class="body_text"><bdt className="block-component" />Website, <bdt className="statement-end-if-in-editor" /><bdt className="block-component" /><bdt className="block-component" /></span><span data-custom-class="body_text"><span style={{ fontSize: '15px' }}><bdt className="statement-end-if-in-editor" /></span></span><span data-custom-class="body_text">express an interest in obtaining information about us or our products and Services, when you participate in activities on the <span style={{ fontSize: '15px' }}><bdt className="block-component" />Website<bdt className="statement-end-if-in-editor" /><bdt className="block-component" /><bdt className="block-component" /></span><bdt className="block-component" /> (such as by posting messages in our online forums or entering competitions, contests or giveaways)<bdt className="statement-end-if-in-editor" /></span></span><span data-custom-class="body_text">&nbsp;or otherwise when you contact us.</span></span></span></div><div style={{ lineHeight: '1.5' }}><br /></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text">The personal information that we collect depends on the context of your interactions with us and the <span style={{ fontSize: '15px' }}><span data-custom-class="body_text"><bdt className="block-component" />Website<bdt className="statement-end-if-in-editor" /><bdt className="block-component" /><bdt className="block-component" /></span>, the choices you make and the products and features you use. The personal information we collect may include the following:<bdt className="block-component" /></span></span></span></span></div><div style={{ lineHeight: '1.5' }}><br /></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><strong>Personal Information Provided by You.</strong> We collect <span style={{ fontSize: '15px' }}><span data-custom-class="body_text"><bdt className="forloop-component" /><bdt className="question">email addresses</bdt>;&nbsp;</span><span data-custom-class="body_text"><bdt className="forloop-component" /><bdt className="question">usernames</bdt>;&nbsp;</span><span data-custom-class="body_text"><bdt className="forloop-component" /><bdt className="question">passwords</bdt>;&nbsp;</span><span data-custom-class="body_text"><bdt className="forloop-component" /><bdt className="question">location</bdt>;&nbsp;</span><span data-custom-class="body_text"><bdt className="forloop-component" />and other similar information.</span><span data-custom-class="body_text"><bdt className="statement-end-if-in-editor" /><bdt className="block-component"><bdt className="block-component" /></bdt></span></span></span></span></span></div><div style={{ lineHeight: '1.5' }}><br /></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text">All personal information that you provide to us must be true, complete and accurate, and you must notify us of any changes to such personal information.<span style={{ fontSize: '15px' }}><bdt className="statement-end-if-in-editor"><bdt className="statement-end-if-in-editor" /></bdt></span><bdt className="block-component" /><span data-custom-class="body_text"><span style={{ fontSize: '15px' }}><bdt className="statement-end-if-in-editor"><bdt className="statement-end-if-in-editor"><span style={{ fontSize: '15px' }}><span data-custom-class="body_text"><span style={{ fontSize: '15px' }}><span data-custom-class="body_text"><bdt className="statement-end-if-in-editor"><bdt className="statement-end-if-in-editor"><bdt className="block-component" /></bdt></bdt></span></span></span></span><span style={{ color: 'rgb(89, 89, 89)', fontSize: '15px' }}><span data-custom-class="body_text"><span style={{ color: 'rgb(89, 89, 89)', fontSize: '15px' }}><span data-custom-class="body_text"><bdt className="statement-end-if-in-editor"><bdt className="block-component" /></bdt></span></span></span></span></bdt></bdt></span></span><bdt className="block-component" /></span></span></span></div><div style={{ lineHeight: '1.5' }}><br /></div><div id="infouse" style={{ lineHeight: '1.5' }}><span style={{ color: 'rgb(127, 127, 127)' }}><span style={{ color: 'rgb(89, 89, 89)', fontSize: '15px' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span id="control" style={{ color: 'rgb(0, 0, 0)' }}><strong><span data-custom-class="heading_1">2. HOW DO WE USE YOUR INFORMATION?</span></strong></span></span></span></span></span></div><div><div style={{ lineHeight: '1.5' }}><br /></div><div style={{ lineHeight: '1.5' }}><span style={{ color: 'rgb(127, 127, 127)' }}><span style={{ color: 'rgb(89, 89, 89)', fontSize: '15px' }}><span data-custom-class="body_text"><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text"><strong><em>In Short: &nbsp;</em></strong><em>We process your information for purposes based on legitimate business interests, the fulfillment of our contract with you, compliance with our legal obligations, and/or your consent.</em></span></span></span></span></span></span></div></div><div style={{ lineHeight: '1.5' }}><br /></div><div style={{ lineHeight: '1.5' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span style={{ fontSize: '15px', color: 'rgb(89, 89, 89)' }}><span data-custom-class="body_text">We use personal information collected via our <span style={{ fontSize: '15px' }